import { Component } from 'react';

class Page7 extends Component {

    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()
  }
    render() {
        return (
            <div className="sheet">
                 <h1 id="p1title" className="bold center">Practicing</h1>
                <div id="page1" className="left">
                    <div className='container_for_small_margin'>
                        <p>Is there any part of your coping strategy that you want to practice together?</p>
                    </div>

                    <div id="instruction_box_number_1_page_7_sheet_13" className="custom_svg demo_box container_for_small_margin">
                        <p className="top_line_in_instruction_box other_text_in_instruction_box">If your mentee says yes, practice with them for 10-15 minutes</p>
                    </div>
                    
                    <div className='container_for_small_margin'>
                        <p>Is there anything you need to help you use this strategy outside of mentoring? </p>
                    </div>

                    <div id="instruction_box_number_1_page_7_sheet_13" className="custom_svg demo_box container_for_small_margin">
                        <p className="top_line_in_instruction_box other_text_in_instruction_box">
                            Talk with your mentee about the help they need.<br/>
                            For example, you could help them think about setting reminders or using their toolkit. 
                        </p>
                    </div>
                </div>
            </div>
        )
    }
    
}

export default Page7;
